import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import Layout from './components/layout';
import Style from './style/global.css'

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
	<React.StrictMode>
		<Layout>
			<App></App>
			</Layout>
	</React.StrictMode>
);
